import React from 'react';
import './index.css';
import PeopleData from './data/people.json';


const App = () => {
  const list = PeopleData.map(item=>{
    return(
      <div key={item.id}>
        <h1>{item.first_name}</h1>
        <h1>{item.last_name}</h1>
      </div>
    )
  })
  return (
    <div className="app">
      {list}
    </div>
  );
}

export default App;
